import { React, useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import Header from "../components/Navbar";
import Footer from "../components/Footer";

const Cart = () => {
  const [companyData, setCompanyData] = useState([]);
  const [userData, setUserData] = useState(
    JSON.parse(localStorage.getItem("userData"))
  );
  const navigate = useNavigate();

  const loadCompany = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/getComp", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
      });
      const data = await response.json();
      setCompanyData(data[0]); // Assuming data is an array of company objects
    } catch (error) {
      console.error("Error loading company data:", error);
    }
  };

  useEffect(() => {
    loadCompany();
  }, []);

  const handleMoreButtonClick = (co) => {
    if (!userData) {
      alert("Please login to get details!");
      navigate("/Company");
    } else {
      navigate(`/CompanyDetails/${co}`);
    }
  };

  return (
    <div>
      <div>
        <Header />
      </div>
      <div className="hm-gradient">
        <main>
          <div className="container text-success" style={{ marginTop: "15px" }}>
            <div className="card mb-4 rounded ">
              <div className="card-body">
                <div className="row">
                  <div className="col-md-12">
                    <h2 className="pt-3 pb-4 mb-5 text-center font-bold font-up deep-purple-text">
                      Your Cart
                    </h2>
                  </div>
                </div>
                <table className="table table-striped text-success">
                  <thead>
                    <tr>
                      <th>No.</th>
                      <th>Name</th>
                      <th>Quantity</th>
                      <th>Option</th>
                      <th>Amount</th>
                    </tr>
                  </thead>
                  <tbody>
                    {companyData.length > 0 ? (
                      companyData.map((company, index) => (
                        <tr key={company._id}>
                          <th scope="row">{index + 1}</th>
                          <td>{company.company_name}</td>
                          <td>{company.description}</td>
                          <td>{company.location}</td>
                          <td>{company.city}</td>
                          <td></td>
                        </tr>
                      ))
                    ) : (
                      <tr>
                        <td colSpan="6" className="text-center text-success">
                          No Item Added
                        </td>
                      </tr>
                    )}
                  </tbody>
                </table>
                <button
                  className="btn btn-dark text-white mt-0 mb-0 mr-3"
                  onClick={() => handleMoreButtonClick(company._id)}
                >
                  More
                </button>
              </div>
            </div>
          </div>
        </main>
      </div>
      <div>
        <Footer />
      </div>
    </div>
  );
};

export default Cart;
